0=Operation: Potshot@ Location: Border between Germany and Poland@ 
1=--------------------------------------------------@@ Despite our best 
2=efforts, the Soviets continue to threaten to overrun our defensive 
3=lines.@@ One of the critical positions have been recently bombarded 
4=by Soviet air power, and is in need of reinforcements. The Allied 
5=forces are sending into their newest weapon - the Heavy Artillery, 
6=which fires from incredible range.@@ The artillery pieces are 
7=vulnerable to air power. Escort them, and ensure the line is held 
8=until further instructions. 

